import "bootstrap/dist/css/bootstrap.min.css";
import Tilt from "react-parallax-tilt";

function Home2() {
  return (
    <Container>
      <div class="wrapper1">

<div class="container1" id="c01">
<img src={myImg} className="img-fluid" alt="avatar" />
</div>
</div>

    </Container>
  );
}
export default Home2;
